import styled from 'styled-components'
import '../App.css'

export const InputButton = styled.input`
background-color: #A44F51;
width: 100%;
padding: 0.5em;
font-size: 14px;
font-family: Montserrat, "Open Sans", Helvetica, Arial, sans-serif;
